:root {
  --alto: #dedede80;
  --alto-2: #dbdbdb;
  --apple: #49bf46;
  --apple-2: #49cd46;
  --athens-gray: #eeeff5;
  --black: #000000;
  --black-haze: #f6f6f9;
  --cinnabar: #eb3c3c;
  --gray: #909090;
  --gray-2: #808080;
  --gray-nurse: #e9e9e9;
  --green-haze: #109962;
  --green-haze-2: #10996226;
  --gunsmoke: #848484;
  --log-cabin: #222222;
  --mahogany: #d15151;
  --mahogany-2: #d1515126;
  --mine-shaft: #2f2f2f;
  --mist-gray: #c4c4c4;
  --mist-gray-2: #c4c4c44c;
  --oslo-gray: #858d9b;
  --picton-blue: #45a1dc;
  --picton-blue-2: #45a1dc26;
  --shady-lady: #aaaaaa;
  --white: #ffffff;
  --zumthor: #eff5fdb2;

  --font-size-10_2px: 10.2px;
  --font-size-11_3px: 11.3px;
  --font-size-11_9px: 11.9px;
  --font-size-12_9px: 12.9px;
  --font-size-13_6px: 13.6px;
  --font-size-14_5px: 14.5px;
  --font-size-15px: 15px;
  --font-size-16_1px: 16.1px;
  --font-size-16_5px: 16.5px;
  --font-size-17px: 17px;
  --font-size-18_5px: 18.5px;
  --font-size-19_6px: 19.6px;
  --font-size-24_2px: 24.2px;
  --font-size-25_5px: 25.5px;
  --font-size-3_4px: 3.4px;
  --font-size-4_1px: 4.1px;
  --font-size-4_5px: 4.5px;
  --font-size-5_1px: 5.1px;
  --font-size-5_4px: 5.4px;
  --font-size-5px: 5px;
  --font-size-6_8px: 6.8px;
  --font-size-7_5px: 7.5px;
  --font-size-9_7px: 9.7px;
  --font-size-l: 20px;
  --font-size-m: 19px;
  --font-size-s: 18px;
  --font-size-xl: 23px;
  --font-size-xs: 16px;
  --font-size-xxl: 30px;
  --font-size-xxs: 14px;
  --font-size-xxxl: 36px;
  --font-size-xxxs: 12px;
  --font-size-xxxxs: 11px;
  --font-size-xxxxxs: 10px;
  --font-size-xxxxxxs: 9px;

  --font-family-inter: "Inter", Helvetica;
  --font-family-poppins: "Poppins", Helvetica;
  --font-family-proxima_nova-regular: "Proxima Nova-Regular", Helvetica;
  --font-family-proxima_nova-semibold: "Proxima Nova-Semibold", Helvetica;
  --font-family-roboto: "Roboto", Helvetica;
}
.roboto-normal-black-11-3px {
  color: var(--black);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-11_3px);
  font-style: normal;
  font-weight: 400;
}
.roboto-bold-black-15px {
  color: var(--black);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-15px);
  font-style: normal;
